import React from 'react';
import { Link } from 'react-router-dom';

const data = get(Date);

function Registropt() {
    return (
        <div>
            <h2>Registro de ponto</h2>
            <h3> Pontos do dia {data}</h3>
        </div>
    );
}

export default Registropt;
